        <img
          src="https://images.pexels.com/photos/2709388/pexels-photo-2709388.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
          className=""
          alt="female face"
        />
        <p>
          Incurable food nerd. Travel fan. Zombie fanatic. Twitter ninja. Tv
          advocate. Music enthusiast.
        </p>
      </div>
    </div>
  );
}
